#include "MainWindow.h"
#include "Game.h"

Game::Game(MainWindow& wnd)
	:
	wnd(wnd),
	gfx(wnd),
	b(gfx),
	rng(std::random_device()()),
	snake({ 2,2 }),
	f(rng,b,snake),
	obs(rng,b,snake)
{
}

void Game::Go()
{
	gfx.BeginFrame();	
	UpdateModel();
	ComposeFrame();
	gfx.EndFrame();
}

void Game::UpdateModel()
{
	if (wnd.kbd.KeyIsPressed(VK_RETURN))
		isStarted = true;
	if (isStarted)
	{
		if (!isOver)
		{
			if (wnd.kbd.KeyIsPressed(VK_UP))
			{
				delta_loc = { 0,-1 };
			}
			else if (wnd.kbd.KeyIsPressed(VK_DOWN))
			{
				delta_loc = { 0,1 };
			}
			else if (wnd.kbd.KeyIsPressed(VK_LEFT))
			{
				delta_loc = { -1,0 };
			}
			else if (wnd.kbd.KeyIsPressed(VK_RIGHT))
			{
				delta_loc = { 1,0 };
			}
		}
		/*Screen refreshes 60 times a second, to decrease the speed of the snake,
		  we use thr snakeMoveCounter. We only move the snake if the movecounter is
		  greater than 20, so it moves 3 times a second now.*/
		if (!(eatenCount % 2))
		{
			eatenCount = 1;
			snakeRate--;
			milestone++;
		}
		snakeMoveCounter++;
		if (snakeMoveCounter >= snakeRate)
		{
			snakeMoveCounter = 0;
			Location next = snake.GetNextHeadLocation(delta_loc);
			bool isCrashed = next == obs.GetLocation();
			if (!b.isInBoard(next) || snake.isInTile(next) || isCrashed)
			{
				isOver = true;
			}
			else
			{
				bool isEaten = next == f.GetLocation();
				if (isEaten)
				{
					snake.Grow();
				}
				snake.MoveBy(delta_loc);							//Moves the snake by delta_loc, which specifies direction
				if (isEaten)
				{
					f.Respawn(rng, b, snake);
					eatenCount++;
				}
			}
		}
	}
}

